import React from "react";
import image from '../img/first.jpeg';
import image2 from '../img/second.jpeg'

function Prueba() {
    return(
        
        <>
        <picture>
            <source srcSet={image} media="(minWidth=1200px)"/>
            <img src={image2}/>
            </picture>
        </>
    );
}
export default Prueba;
